import { Link } from "react-router-dom";
import { useState } from "react";

const Catways = () => {
  const [showModal, setShowModal] = useState(false); 
  const [catwayId, setCatwayId] = useState("");
  return (
    <main className="container">
      <div className="text-center">
        <h1>Catways</h1>
      </div>
      <hr />
        <div>
            <h2>Vous pouvez gérer les catways ici</h2>
            <div className="mb-4">
                <button type="button" className="btn btn-primary m-5" data-bs-toggle="modal" data-bs-target="#ModalList">Liste des catways</button>
            </div>

            {/*Modale*/}
            <div className="modal fade" id="ModalList" tabindex="-1" aria-hidden="true"> 
                <div className="modal-dialog modal-dialog-centered">
                    <div className="modal-content bg-dark text-white">
                        <div className="modal-header">
                            <h3 className="modal-title" id="modalLabel">Liste des catways</h3>
                        </div>
                        <div className="modal-body">
                            <div className="row align-items-center">
                                <p>Lien avec MongoDB à faire</p>
                            </div>
                        <div className="modal-footer">
                        <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Fermer</button>
                        </div>
                    </div>
                </div>
          </div>
        </div>
      </div>      
    </main>
  );
};

export default Catways;
